import React, { Component } from "react";
import NavBar from "../../components/NavBar/NavBar";
import "./Home.css";

class Home extends Component {
  state = {
    someShit: "Fuck"
  };

  render() {
    return (
      <>
        <div>
          Will the real Slim Shady please stand up?. I repeat, will the real
          Slim Shady please stand up?. We're gonna have a problem here. Y'all
          act like you never seen a white person before. Jaws all on the floor
          like Pam like Tommy just burst in the door. And started whoopin' her
          ass worse than before.I'm Slim Shady, yes, I'm the real Shady. All you
          other Slim Shadys are just imitating. So won't the real Slim Shady
          please stand up. Please stand up, please stand up?. 'Cause I'm Slim
          Shady, yes, I'm the real Shady. All you other Slim Shadys are just
          imitating. So won't the real Slim Shady please stand up. Please stand
          up, please stand up?I've created a monster, â€˜cause nobody wants to.
          See Marshall no more, they want Shady, I'm chopped liver. Well, if you
          want Shady, this is what I'll give ya. A little bit of weed mixed with
          some hard liquor. Some vodka that'll jump start my heart quicker. Than
          a shock when I get shocked at the hospital.Can't you see what you do
          to me, baby?. You make me crazy, you make me act like a maniac. I'm
          like a lunatic, you make me sick. You're truly the only one who can do
          this to me. You just make me get so crazy. I go schizo, I get so
          insane I just go schizophrenic. One minute I wanna slit your throat,
          the next I wanna sex.
        </div>
        <div className="NavBar">
          <NavBar />
        </div>
      </>
    );
  }
}

export default Home;
